  summary: Adds all linetypes to the list from the definition in a LIN file.
  remarks: >-
    If the file is not found in the specified folder, it will try to find them in the list of supported folders defined in the DxfDocument.<br />

    Any text style or shape present in the linetype definition must be previously defined in the DxfDocument, if not an exception will be generated.
  example: []
  syntax:
    content: public void AddFromFile(string file, bool reload)
    parameters:
    - id: file
      type: System.String
      description: File where the definition is located.
    - id: reload
      type: System.Boolean
      description: Specifies if the linetype definitions of the file will overwrite the existing ones, in case another with the same name exists in the file.
