  assemblies:
  - netDxf
  namespace: netDxf.Collections
  summary: Adds a linetype to the list from the definition in a LIN file.
  remarks: >-
    If the file is not found in the specified folder, it will try to find them in the list of supported folders defined in the DxfDocument.<br />

    Any text style or shape present in the linetype definition must be previously defined in the DxfDocument, if not an exception will be generated.
  example: []
  syntax:
    content: public bool AddFromFile(string file, string linetypeName, bool reload)
    parameters:
    - id: file
      type: System.String
      description: File where the definition is located.
    - id: linetypeName
      type: System.String
      description: Name of the line type definition to read (ignore case).
    - id: reload
      type: System.Boolean
      description: Specifies if the linetype definition of the file will overwrite the existing one, in case another with the same name exists in the file.
    return:
      type: System.Boolean
      description: >-
        True if the linetype has been added from the linetype definitions LIN file; false otherwise.

        It will return false if the linetype is present in the file and the reload argument is false.
    content.vb: Public Function AddFromFile(file As String, linetypeName As String, reload As Boolean) As Boolean
